-- ----------------------------
-- View structure for diagnoserecord_info
-- ----------------------------
DROP VIEW IF EXISTS `diagnoserecord_info`;
CREATE ALGORITHM = UNDEFINED SQL SECURITY DEFINER VIEW `diagnoserecord_info` AS select `diagnoserecord`.`PCardID` AS `PCardID`,`passenger`.`PName` AS `PName`,`passenger`.`Age` AS `Age`,`train`.`TName` AS `TName`,`train`.`SDate` AS `SDate`,`taketrainrecord`.`CarrigeID` AS `CarrigeID`,`taketrainrecord`.`SeatRow` AS `SeatRow`,`taketrainrecord`.`SeatNo` AS `SeatNo` from (((`diagnoserecord` join `passenger`) join `taketrainrecord`) join `train`) where ((`diagnoserecord`.`PCardID` = `passenger`.`PCardID`) and (`diagnoserecord`.`PCardID` = `taketrainrecord`.`PCardID`) and (`taketrainrecord`.`TID` = `train`.`TID`));

-- ----------------------------
-- Procedure structure for count_train
-- ----------------------------
DROP PROCEDURE IF EXISTS `count_train`;
delimiter ;;
CREATE PROCEDURE `count_train`()
BEGIN
	TID,
	count(*) 
	FROM
		TakeTrainRecord 
	GROUP BY
		TakeTrainRecord.TID;
END
;;
delimiter ;

-- ----------------------------
-- Function structure for getcount
-- ----------------------------
DROP FUNCTION IF EXISTS `getcount`;
delimiter ;;
CREATE FUNCTION `getcount`(`ID` char(18),`y` year)
 RETURNS int
  READS SQL DATA 
BEGIN
	#Routine body goes here...
	DECLARE count int;
	select count(*) from taketrainrecord,train
	where taketrainrecord.tid = train.tid
	and YEAR(train.SDate) = y 
	and taketrainrecord.PCardID = ID
	group by taketrainrecord.PCardID
	into count;
	RETURN count;
END
;;
delimiter ;

-- ----------------------------
-- Triggers structure for table diagnoserecord
-- ----------------------------
DROP TRIGGER IF EXISTS `trigger_update_diagnose`;
delimiter ;;
CREATE TRIGGER `trigger_update_diagnose` AFTER UPDATE ON `diagnoserecord` FOR EACH ROW BEGIN
	IF
		new.DStatus = 1 THEN
			UPDATE traincontactor 
			SET DStatus = 1 
		WHERE
			CCardID = new.PCardID;
		END IF;

END
;;
delimiter ;

-- ----------------------------
-- Triggers structure for table diagnoserecord
-- ----------------------------
DROP TRIGGER IF EXISTS `trigger_add_diagnose`;
delimiter ;;
CREATE TRIGGER `trigger_add_diagnose` AFTER INSERT ON `diagnoserecord` FOR EACH ROW BEGIN
	IF
		(
			new.DStatus = 1 
			AND new.PCardID IN (
			SELECT
				taketrainrecord.PCardID 
			FROM
				taketrainrecord,
				train 
			WHERE
				taketrainrecord.PCardID = new.PCardID 
				AND taketrainrecord.TID = train.TID 
				AND taketrainrecord.SStatus = 1 
				AND datediff( new.FDay, train.SDate ) BETWEEN 0 
				AND 14 
			) 
			) THEN
			train.SDate AS CDate,
			t2.PCardID AS CCardID,
			2 AS DStatus,
			new.PCardID AS PCardID 
		FROM
			train,
			taketrainrecord t1,
			taketrainrecord t2 
		WHERE
			new.PCardID = t1.PCardID 
			AND t1.TID = train.TID 
			AND t1.sstatus = 1 
			AND datediff( new.FDay, train.SDate ) BETWEEN 0 
			AND 14 
			AND t1.TID = t2.TID 
			AND t1.CarrigeID = t2.CarrigeID 
			AND new.PCardID <> t2.PCardID 
			AND abs( t1.SeatRow - t2.SeatRow )<= 1 
			AND t2.sstatus = 1;	
	END IF;
END
;;
delimiter ;

